INSERT INTO `adminnotification_inbox` VALUES (1,4,'2021-04-08 14:40:58','Disable Notice','To improve performance, collecting statistics for the Magento Report module is disabled by default. \nYou can enable it in System Config.','',0,0),(2,4,'2021-05-11 20:44:41','Magento Open Source 2.4.2-p1 &amp; 2.3.7 deliver important security updates','The latest releases of Magento Open Source – 2.3.7 and 2.4.2-p1 – are now generally available. The latest release of Magento Open Source includes important security updates. With these important updates we strongly recommend that you upgrade to ensure your sites maintain the highest level of security. You can review the release notes for more information about all of the updates. Learn how this release can help you save time and maximize resources at Magento.com/blog.','https://devdocs.magento.com/guides/v2.3/release-notes/bk-release-notes.html ',0,0),(3,4,'2021-07-20 00:00:00','FLASH SALES - 15% OFF','15% EXTRA discount on ALL extensions. Flash sales 3 days only. Check it out &amp; get the code','https://www.mageplaza.com/deals/?utm_source=notification&amp;utm_medium=rss&amp;utm_campaign=july21',0,0),(4,4,'2021-07-22 00:00:00','LAST CHANCE - 15% OFF','15% EXTRA discount on ALL extensions. Last day to have it. Ends . Check it out &amp; get the code','https://www.mageplaza.com/deals/?utm_source=notification&amp;utm_medium=rss&amp;utm_campaign=july21',1,0),(5,4,'2021-08-10 17:53:11','Magento Open Source 2.4.3 available today!','Magento Open Source 2.4.3, along with security-only patches 2.4.2-p1 and 2.3.7-p2, is now generally available. Magento Open Source 2.4.3 includes 33 security and 370+ quality improvements, along with performance and scale enhancements.  With these important updates, we strongly recommend that you upgrade to maintain the highest level of security for your sites. Learn how this release can help you save time and maximize resources in our release blog. ','http://magento.com/blog/magento-news/get-ready-your-peak-season-adobe-commerce-243',1,0),(6,4,'2021-10-01 14:44:47','New, Simplified Upgrade Process and Lifecycle Policy Helps Reduce Your TCO ','Adobe Commerce developed a new release strategy and updated its lifecycle policy in effort to help Merchants lower their total cost of ownership and accelerate their time to innovation. Learn more about how upgrades are now more predictable and easier to implement in our blog.','https://magento.com/blog/accelerating-innovation-through-simplified-release-strategy',1,0),(7,4,'2021-10-22 19:06:48','Magento Technology Stack Evaluation Survey','Please take a few minutes to fill out this survey https://forms.office.com/r/DLN8K3h2h0. We appreciate your effort to support the future of Adobe Commerce!','https://forms.office.com/r/DLN8K3h2h0',0,0);
