		latitude = data.results[0].geometry.location.lat;\n						longitude = data.results[0].geometry.location.lng;\n						\n						var locations = [\n					[html, latitude, longitude, 2]\n					];\n				\n					var map = new google.maps.Map(document.getElementById(\'footer-map\'), {\n						zoom: 14,\n						scrollwheel: false,\n						navigationControl: true,\n						mapTypeControl: false,\n						scaleControl: false,\n						draggable: true,\n						center: new google.maps.LatLng(latitude, longitude),\n						mapTypeId: google.maps.MapTypeId.ROADMAP\n					});\n				\n					var infowindow = new google.maps.InfoWindow();\n				\n					var marker, i;\n				\n					for (i = 0; i < locations.length; i++) {  \n				  \n						marker = new google.maps.Marker({ \n						position: new google.maps.LatLng(locations[i][1], locations[i][2]), \n						map: map ,\n						icon: image\n						});\n				\n				\n					  google.maps.event.addListener(marker, \'click\', (function(marker, i) {\n						return function() {\n						  infowindow.setContent(locations[i][0]);\n						  infowindow.open(map, marker);\n						}\n					  })(marker, i));\n					}\n					}\n				}\n			});\n		})(jQuery);\n	});\n	</script>','2021-09-14 10:52:06','2021-09-14 10:52:06',1),(26,'Claue Footer 3 Custom Menu','claue_footer3_custom_menu','<ul class=\"custom-menu text-uppercase\">\n<li><a href=\"#\">Shop</a></li>\n<li><a href=\"#\">About Us</a></li>\n<li><a href=\"#\">Blog</a></li>\n<li><a href=\"#\">Help &amp; Contact</a></li>\n<li><a href=\"#\">Return Policy</a></li>\n<li><a href=\"#\">Legal Notice</a></li>\n</ul>','2021-09-14 10:52:06','2021-09-14 10:52:06',1),(27,'Footer 3 Logo And Social','footer_logo_and_social','<div class=\"text-center\"><img src=\"http://claue.magesolution.com/pub/media/logo/default/logo.png\" alt=\"\" /></div>\n<ul class=\"social-link margin-top25\">\n<li><a href=\"#\">&nbsp;<span class=\"fa fa-facebook\">&nbsp;</span></a></li>\n<li><a href=\"#\">&nbsp;<span class=\"fa fa-twitter\">&nbsp;</span></a></li>\n<li><a href=\"#