r_id=\"claue_home_2_banner_lookbook\" template=\"banner.phtml\"}}</div>\r\n<div class=\"panel-block-row col-md-6\">{{widget type=\"MGS\\Promobanners\\Block\\Widget\\Banner\" banner_id=\"rrr\" template=\"banner.phtml\"}}</div>\r\n<div class=\"panel-block-row col-md-6\">\r\n<h4 class=\"margin-top10\" style=\"font-size: 20px; line-height: 26px; color: #222222; text-align: center;\">Título</h4>\r\n<p class=\"no-margin\" style=\"font-size: 14px; color: #878787; text-align: center;\">Descrição do tipo</p>\r\n</div>\r\n<div class=\"panel-block-row col-md-6\">\r\n<h4 class=\"margin-top10\" style=\"font-size: 20px; line-height: 26px; color: #222222; text-align: center;\">Título</h4>\r\n<p class=\"no-margin\" style=\"font-size: 14px; color: #878787; text-align: center;\">Descrição do tipo</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"col-lg-4 col-md-4 col-sm-12 col-xs-12 \">\r\n<div class=\"row\">\r\n<div class=\"panel-block-row col-md-6 button-colour-transparent button-hover-colour-black\">{{widget type=\"MGS\\Promobanners\\Block\\Widget\\Banner\" banner_id=\"claue_home_2_banner_summer_sale\" template=\"banner.phtml\"}}</div>\r\n<div class=\"panel-block-row col-md-6\">{{widget type=\"MGS\\Promobanners\\Block\\Widget\\Banner\" banner_id=\"rerererr\" template=\"banner.phtml\"}}</div>\r\n<div class=\"panel-block-row col-md-6\">\r\n<h4 class=\"margin-top10\" style=\"font-size: 20px; line-height: 26px; color: #222222; text-align: center;\">Título</h4>\r\n<p class=\"no-margin\" style=\"font-size: 14px; color: #878787; text-align: center;\">Descrição do tipo</p>\r\n</div>\r\n<div class=\"panel-block-row col-md-6\">\r\n<h4 class=\"margin-top10\" style=\"font-size: 20px; line-height: 26px; color: #222222; text-align: center;\">Título</h4>\r\n<p class=\"no-margin\" style=\"font-size: 14px; color: #878787; text-align: center;\">Descrição do tipo</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"col-lg-4 col-md-4 col-sm-12 col-xs-12 \">\r\n<div class=\"row\">\r\n<div class=\"panel-block-row col-md-6\">{{widget type=\"MGS\\Promobanners\\Block\\Widget\\Banner\" banner_id=\"yhh\" template=\"banner.phtml\"}}</div>\r\n<div class=\"panel-block-row col-md-6\">{{widget type=\"MGS\\Promobanners\\Block\\Widget\\Banner\" banner_id=\"kikiki\" template=\"banner.phtml\"}}</div>\r\n<div class=\"panel-block-row col-md-6\">\r\n<h4 class=\"margin-top10\" style=\"font-size: 20px; line-height: 26px; color: #222222; text-align: center;\">Título</h4>\r\n<p class=\"no-margin\" style=\"font-size: 14px; color: #878787; text-align: center;\">Descrição do tipo</p>\r\n</div>\r\n<div class=\"panel-block-row col-md-6\">\r\n<h4 class=\"margin-top10\" style=\"font-size: 20px; line-height: 26px; color: #222222; text-align: center;\">Título</h4>\r\n<p class=\"no-margin\" style=\"font-size: 14px; color: #878787; text-align: center;\">Descrição do tipo</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"\" style=\"padding-top: 70px;\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-12 col-md-12\">\r\n<div class=\"row\">\r\n<div class=\"panel-block-row col-md-12 col-xs-12\">{{block class=\"MGS\\Mpanel\\Block\\Products\\Tabs\" mgs_panel_title=\"PRODUTOS\" mgs_panel_note=\"\" limit=\"4\" perrow=\"4\" category_ids=\"6,7,8\" use_slider=\"0\" loadmore=\"1\" ratio=\"1\" tabs=\"mgs_new_products_tabs,mgs_sale_products_tabs,mgs_rate_products_tabs\" template=\"products/tabs/grid.phtml\" tab_template=\"1\"labels=\"Novidade,Promoção, +Populares\"}}</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"\" style=\"padding-top: 52px; padding-bottom: 34px;\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-12 col-md-12\">\r\n<div class=\"row\">\r\n<div class=\"panel-block-row col-md-12\">{{widget type=\"MGS\\Blog\\Block\\Widget\\Latest\" mgs_panel_title=\"MONDO GIMOKA\" post_category=\"1,2,3\" number_of_posts=\"3\" items=\"3\" show_thumbnail=\"1\" mgs_panel_note=\"\" template=\"widget/default.phtml\" show_short_content=\"1\" limit_characters_short_content=\"120\" view_as=\"owl_carousel\" autoplay=\"0\" stop_auto=\"0\" navigation=\"0\" pagination=\"0\" number_row=\"1\"}}</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>','2021-09-17 20:56:26','2021-09-17 20:56:26',1,0,NULL,'','',NULL,NULL,NULL,NULL,''),(14,'Politicas e Procedimentos','1column','','','politicas-e-procedimentos','','<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-12 col-md-12\">\r\n<div class=\"row\">\r\n<div class=\"panel-block-row col-md-12\">\r\n<div class=\"page-title\">\r\n<h1><span style=\"font-family: helvetica; color: #000;\">Políticas e Procedimentos<br></span></h1>\r\n<p>&nbsp;</p>\r\n</div>\r\n<ul class=\"disc\">\r\n<li><span style=\"font-family: helvetica; font-size: medium;\"><a href=\"#answer1\">Navegação</a></span></li>\r\n<li><span style=\"font-family: helvetica; font-size: medium;\"><a href=\"#answer2\">Segurança e Privacidade</a></span></li>\r\n<li><span style=\"font-family: helvetica; font-size: medium;\"><a href=\"#answer3\">Pagamento</a></span></li>\r\n<li><span style=\"font-family: helvetica; font-size: medium;\"><a href=\"#answer4\">Entrega</a></span></li>\r\n<li><span style=\"font-family: helvetica; font-size: medium;\"><a href=\"#answer5\">Prazo de Entrega</a></span></li>\r\n<li><span style=\"font-family: helvetica; font-size: medium;\"><a href=\"#answer6\">Trocas e Devoluções</a></span></li>\r\n<li><span style=\"font-family: helvetica; font-size: medium;\"><a href=\"#answer7\">Atendimento</a></span></li>\r\n<li><span style=\"font-family: helvetica; font-size: medium;\"><a href=\"#answer9\">Arrependimento</a></span></li>\r\n<li><span style=\"font-family: helvetica; font-size: medium;\"><a href=\"#answer8\">Política de Promoções e Cupons de Desconto</a></span></li>\r\n</ul>\r\n<p><span style=\"font-family: helvetica;\">&nbsp;</span></p>\r\n<dl>\r\n<dt id=\"answer1\"><span style=\"text-decoration: underline; font-size: large;\"><span style=\"font-family: helvetica;\"><strong>Navegação</strong></span></span></dt>\r\n</dl>\r\n<p>Fazer compras na loja <strong>Gimoka Brasil (Buon Gusto Italiano)</strong>&nbsp;é fácil e seguro. Você pode navegar tranquilamente, conhecendo nossos produtos, promoções e lançamentos ou se preferir pode ir diretamente ao produto desejado, bastando para isso usar os botões de <strong>“filtros”</strong> ou a <strong>“caixa de busca”</strong>, que aparecem na parte superior da tela.&nbsp;&nbsp;Além das fotos, nossos produtos possuem uma descrição detalhada com a finalidade e modo de usar, que irão auxiliar na sua escolha.&nbsp;Para comprar você deve colocar o produto desejado no carrinho, clicando no botão&nbsp;<strong>“adicionar ao carrinho”</strong>&nbsp;e depois indicar a quantidade. Quando concluir a visita e quiser efetivar a compra, é só você voltar para o carrinho e clicar o botão <strong>“efetuar o pagamento”</strong>.&nbsp;Se você já for cliente é só inserir o seu e-mail e senha e sua compra será finalizada.</p>\r\n<p>&nbsp;</p>\r\n<dl>\r\n<dt id=\"answer2\"><span style=\"text-decoration: underline; font-size: large;\"><strong>Segurança e Privacidade</strong></span></dt>\r\n</dl>\r\n<p class=\"p1\"><span class=\"s1\">Todas as suas informações pessoais recolhidas, serão usadas para o ajudar a tornar a sua visita no nosso site o mais produtiva e agradável possível. A garantia da confidencialidade dos dados pessoais dos utilizadores do nosso site é importante para a Buon Gusto Italiano. Todas as informações pessoais relativas a membros, assinantes, clientes ou visitantes que usem a Buon Gusto Italiano serão tratadas em concordância com a Lei da Proteção de Dados Pessoais de 26 de outubro de 1998 (Lei n.º 67/98). A informação pessoal recolhida pode incluir o seu nome, e-mail, número de telefone e/ou telemóvel, morada, data de nascimento e/ou outros. O uso da Buon Gusto Italiano pressupõe a aceitação deste Acordo de privacidade. A equipa da Buon Busto Italiano reserva-se ao direito de alterar este acordo sem aviso prévio. Deste modo, recomendamos que consulte a nossa política de privacidade com regularidade de forma a estar sempre atualizado. </span><span class=\"s2\"><strong>Os anúncios</strong></span><span class=\"s3\"> - </span><span class=\"s1\">tal como outros websites, coletamos e utilizamos informação contida nos anúncios. A informação contida nos anúncios, inclui o seu endereço IP (Internet Protocol), o seu ISP (Internet Service Provider, como o Sapo, Clix, ou outro), o browser que utilizou ao visitar o nosso website (como o Internet Explorer ou o Firefox), o tempo da sua visita e que páginas visitou dentro do nosso website. </span><span class=\"s2\"><strong>Ligações a Sites de terceiros - </strong></span><span class=\"s1\">A Buon Gusto Italiano possui ligações para outros sites, os quais, a nosso ver, podem conter informações / ferramentas úteis para os nossos visitantes. A nossa política de privacidade não é aplicada a sites de terceiros, pelo que, caso visite outro site a partir do nosso deverá ler a política de privacidade do mesmo. Não nos responsabilizamos pela política de privacidade ou conteúdo presente nesses mesmos sites.</span></p>\r\n<p>&nbsp;</p>\r\n<dl>\r\n<dt id=\"answer3\"><span style=\"text-decoration: underline; font-size: large;\"><strong>Pagamento</strong></span></dt>\r\n</dl>\r\n<p class=\"p1\"><span class=\"s1\">Para fazer suas compras no Buon Gusto italiano, você tem as seguintes opções de pagamento via Moip / PagSeguro: </span><span class=\"s2\"><strong>Cartão de crédito; Boleto bancário</strong></span><span class=\"s3\"><strong>; </strong></span><span class=\"s2\"><strong>Débito em conta corrente.</strong></span> <span class=\"s1\">Caso o pagamento via boleto bancário não seja efetuado até a data do vencimento, o seu pedido será automaticamente cancelado. Nos cartões de crédito, você pode parcelar suas compras, dependendo do cartão. </span><span class=\"s2\"><strong>Atenção:</strong></span><span class=\"s1\">&nbsp;Não trabalhamos com cartões de crédito emitidos no exterior. Fique atento a todos os detalhes sobre o pagamento no momento da compra. Mas depois que fechar o pedido, somente para a opção de cartão de crédito, você tem a chance de alterar a opção de pagamento, desde que não tenha sido efetivado e o produto ainda não tenha sido enviado para o endereço de entrega. </span><span class=\"s2\"><strong>IMPORTANTE – PAGAMENTO NÃO APROVADO:</strong></span><span class=\"s1\"> As administradoras de cartão nem sempre informam o motivo da reprovação, que podem ser: digitação incorreta de dados como cartão de crédito, validade, código de segurança, limite indisponível, dentre outros.</span></p>\r\n<p>&nbsp;</p>\r\n<dl>\r\n<dt id=\"answer4\"><span style=\"text-decoration: underline; font-size: large;\"><strong>Entrega</strong></span></dt>\r\n</dl>\r\n<p class=\"p1\"><span class=\"s1\">As entregas são realizadas mediante a confirmação do pagamento de um frete. Via SEDEX ou PAC (encomenda normal) dos Correios. O prazo de entrega é contado a partir da confirmação do pagamento pela instituição financeira em dias úteis, ou seja, não inclui sábados, domingos e feriados. As entregas são realizadas de segunda-feira a sexta-feira, das 8h às 22h. Excepcionalmente entregas podem ocorrer aos sábados, domingos e feriados. A entrega é de responsabilidade dos Correios, que em alguns casos, não estão cumprindo os prazos estabelecidos, especialmente no PAC (encomenda normal). Após o envio da encomenda, você recebe uma mensagem, de nossa Loja Virtual, com andamento do seu pedido nos Correios e o número de rastreamento. Por meio deste número, você pode rastrear seu pedido no site dos correios (<a href=\"http://www.correios.com.br/\"><span class=\"s2\">www.correios.com.br</span></a>). IMPORTANTE: Se houver três tentativas de entrega sem sucesso, o pedido retornará para nossa Matriz em São Paulo/SP. Ocorrendo isso entre em contato com nossa central de atendimento para continuidade do envio pelo telefone (11) 3846-1783 ou entraremos em contato com você via telefone ou e-mail.</span></p>\r\n<p>&nbsp;</p>\r\n<dl>\r\n<dt id=\"answer5\"><span style=\"text-decoration: underline; font-size: large;\"><strong>Prazo de Entrega</strong></span></dt>\r\n</dl>\r\n<p>Os prazos informados são estimados e poderão sofrer atrasos devido a fatores alheios a nossa vontade, como por exemplo: chuvas fortes, greves, áreas de risco. <strong>Sedex&nbsp;</strong>De 3 a 5 dias úteis.&nbsp;Obs: São Paulo Capital e Grande São Paulo os pedidos poderão ser entregues por empresa de transportes, mesmo que o cliente tenha escolhido a opção Sedex.&nbsp;<strong>PAC&nbsp;</strong>De 4 a 15 dias úteis.&nbsp;Obs: para as regiões Norte e Nordeste o prazo pode ser de 15 a 20 dias úteis, dependendo da localidade.* Após aprovação, liberação e postagem do pedido.</p>\r\n<p><em>&nbsp;</em></p>\r\n<dl>\r\n<dt id=\"answer6\"><span style=\"text-decoration: underline; font-size: large;\"><strong>Trocas e Devoluções</strong></span></dt>\r\n</dl>\r\n<p>Todas as suas solicitações e comunicações devem ser realizadas diretamente à Central de Atendimento, informando: pedido, produto e motivo da troca e/ou devolução.&nbsp;Recuse receber produtos entregues com sinais de avaria, embalagem violada ou em desacordo com o pedido.&nbsp;Produtos enviados como brinde só poderão ser trocados em casos de avarias ou quando apresentarem algum tipo de defeito.&nbsp;Obs:&nbsp; para produtos adquiridos em promoção, caso seja solicitado a troca ou devolução, será considerado o valor pago e não valor original.&nbsp;Conheça as regras para trocas/devoluções e em quais situações poderá utilizá-las.&nbsp;<strong>Desistência:&nbsp;</strong>O prazo para desistência da compra é de até 7 (sete) dias corridos a contar do recebimento do produto.&nbsp;O produto deverá estar na embalagem original e sem indícios de uso, acompanhado de sua nota fiscal.&nbsp;<strong>Produto Avariado:&nbsp;</strong>Recuse receber produtos entregues com sinais de avaria, embalagem violada ou em desacordo com o pedido. Caso receba uma encomenda nestas condições, não aceite. Faça uma anotação no verso da nota fiscal ou comprovante de entrega, informando o motivo da recusa e entre em contato com nossa Central de Atendimento.&nbsp;Caso você detecte a avaria após o recebimento e dentro do prazo de 7 (sete) dias corridos, comunique nossa Central de Atendimento e aguarde orientações. Caso seja autorizada a devolução, os produtos deverão estar com a embalagem original e inviolada e acompanhados da respectiva nota fiscal.&nbsp;<strong>Produto com defeito:&nbsp;</strong>O prazo para troca do produto com defeito é de até 7 (sete) dias corridos a contar do recebimento do produto. Dentro desse prazo, o cliente tem o direito de solicitar a troca, desde que o produto esteja na embalagem original, sem indícios de mau uso e acompanhado de sua nota fiscal.&nbsp;No caso de equipamentos térmicos e acessórios, se o produto adquirido em nosso site apresentar defeito após 7 (sete) dias corridos da data do recebimento, mas dentro do prazo de garantia do fabricante, você deverá entrar em contato direto com o fabricante para comunicar o fato e obter esclarecimentos. Se desejar poderá também se dirigir a uma das Assistências Técnicas ou Postos Autorizados credenciados pelo próprio fabricante, indicadas no manual, levando também a nota fiscal.&nbsp;<strong>Produto em desacordo com o dedido:&nbsp;</strong>Caso receba algum produto em desacordo com o seu pedido, você deverá recusar a entrega, fazer anotação no verso da nota fiscal ou comprovante de entrega explicando o motivo da recusa e comunicar imediatamente nossa Central de Atendimento.&nbsp;Caso você detecte a divergência após o recebimento e esteja dentro do prazo de 7 (sete) dias corridos após o recebimento, comunique nossa Central de Atendimento e aguarde orientações para proceder com a devolução. O produto deverá estar na embalagem original, sem indícios de uso e acompanhado de sua nota fiscal.&nbsp;<strong>Restituição de valores -&nbsp;</strong>Caso o produto atenda as exigências acima, a restituição do valor pago se dará das seguintes formas:&nbsp;Cartão de crédito: será solicitado o cancelamento do débito junto à administradora do seu cartão.&nbsp;Boleto bancário: a restituição será feita em sua conta corrente em até 5 (cinco) dias úteis, após recebermos a devolução do produto em nosso estoque.&nbsp;O depósito será realizado na conta corrente do titular, que deverá ser a mesma pessoa que efetuou a compra.&nbsp;Caso não possua conta bancária ou tenha descartado o DANFE, entre em contato com nossa Central de Atendimento e você será orientado de como proceder.&nbsp;<strong>Considerações finais -&nbsp;</strong>A Bonitas na Web não tem obrigação de consertar, trocar ou restituir valores de produtos que apresentem sinais claros de mau uso.&nbsp;Confira sempre o produto no ato do recebimento.&nbsp;Qualquer problema entre em contato com nossa Central de Atendimento.&nbsp;Os produtos a serem trocados devem ser enviado a Bonitas na Web pelos correios e todas as despesas da postagem serão por conta da nossa empresa.&nbsp;Todos os produtos devolvidos passarão por uma análise no momento que chegarem ao nosso Estoque, que poderá levar até 2 (dois) dias úteis.&nbsp;O produto para troca e/ou a restituição do valor pago só será liberado após o parecer final desta análise.&nbsp;Após a análise do produto você poderá optar por receber a restituição do valor total do pedido ou ficar com um crédito do valor para utilizar na próxima compra.&nbsp;Caso seja identificada qualquer divergência, indício de mau uso ou violação do produto, não aceitaremos a devolução e devolveremos o produto ao remetente, após a previa comunicação.</p>\r\n<p>&nbsp;</p>\r\n<dl>\r\n<dt id=\"answer7\"><span style=\"text-decoration: underline; font-size: large;\"><strong>Atendimento</strong></span></dt>\r\n</dl>\r\n<p class=\"p1\"><span class=\"s1\"><strong>Buon Gusto Italiano</strong></span><span class=\"s2\"> - Rua João Pereira, 223 – Lapa, São Paulo, Brasil.&nbsp;CEP: 05074-070 - Telefone: (11) 3846-1783 |&nbsp;Email: <a href=\"mailto:contato@buongustoitaliano.com.br\" target=\"_blank\" rel=\"noopener\">contato@buongustoitaliano.com.br</a></span></p>\r\n<p>&nbsp;</p>\r\n<dl>\r\n<dt id=\"answer9\"><span style=\"text-decoration: underline; font-size: large;\"><strong>Arrependimento de Compra</strong></span></dt>\r\n</dl>\r\nDe acordo com artigo 49 da lei 8078 de 1990 – Código de Defesa do Consumidor, “o consumidor pode desistir do contrato, no prazo de 7 dias a contar de sua assinatura ou do ato de recebimento do produto ou serviço, sempre que a contratação de fornecimento de produtos e serviços ocorrer fora do estabelecimento comercial, especialmente por telefone ou a domicílio.<br>\r\n<p>&nbsp;</p>\r\n<dl>\r\n<dt id=\"answer8\"><span style=\"text-decoration: underline; font-size: large;\"><strong>Política de Promoções e Cupons de Desconto</strong></span></dt>\r\n</dl>\r\n<p>Todas as promoções vigentes em nossa loja não são acumulativas, portanto apenas uma regra de promoção será aplicada em cada processo de compra. A mesma regra é aplicada quanto ao uso de Cupons de desconto, não sendo possível utilizar mais de um cupom por compra. Fica a cargo do cliente escolher e usar o Cupom que mais lhe convem.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>','2021-09-21 11:33:10','2021-09-21 14:08:54',1,0,NULL,'','',NULL,NULL,NULL,NULL,''),(15,'Atendimento','1column','','','atendimento','','<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-12 col-md-12\">\r\n<div class=\"row\">\r\n<div class=\"panel-block-row col-md-12\"><!-- BLOCK contactForm -->\r\n<div class=\"contact-form-content\">\r\n<div class=\"row\">\r\n<div class=\"col-sm-6 col-xs-12 margin-bottom60\">\r\n<h3 class=\" margin-bottom15\">Fale com a Gimoka Brasil</h3>\r\n<form id=\"contact-form\" class=\"form contact\" action=\"https://gimokabrasil.com.br/atendimento\" method=\"post\" 