Fechado</p>\r\n<p>Domingo - Fechado</p>\r\n</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n<!-- /BLOCK contactForm -->\r\n<div class=\"page-bottom\">\r\n<div class=\"content\">&nbsp;</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"map-info margin-top20 padding-top20\">\r\n<div class=\"map-container\"><!--          <div id=\"map-contact\" style=\"height: 650px;\"></div>--> <iframe style=\"border: 0;\" src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3658.3657878455538!2d-46.70841598458971!3d-23.519342665927997!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x94cef86172b50ac7%3A0xa7bb29d9701fc01b!2sBuon%20Gusto%20Italiano!5e0!3m2!1spt-BR!2sbr!4v1632238150093!5m2!1spt-BR!2sbr\" width=\"100%\" height=\"650\" allowfullscreen=\"allowfullscreen\"></iframe></div>\r\n</div>','2021-09-21 14:45:46','2021-09-21 15:35:54',1,0,NULL,'','',NULL,NULL,NULL,NULL,''),(16,'Sobre a Gimoka','1column','','','sobre-a-gimoka','','<div class=\"\" style=\" padding-bottom:20px;\"><div class=\"container\"><div class=\"row\"><div class=\"col-lg-12 col-md-12\"><div class=\"row\"><div class=\"panel-block-row col-md-12 no-padding bottom img-responsive \">{{widget type=\"MGS\\Promobanners\\Block\\Widget\\Banner\" banner_id=\"sobre-gimoka\" template=\"banner.phtml\"}}</div></div></div></div></div></div><div class=\"\" style=\"\"><div class=\"container\"><div class=\"row\"><div class=\"col-lg-12 col-md-12\"><div class=\"row\"><div class=\"panel-block-row col-md-12\"><p>A Gimoka é umas das principais torrefadoras de café da Itália, há mais de 40 anos no mercado, presente em mais de 50 países. Graças às nossas 3 unidades de fabricação, conseguimos produzir todos formatos de café e bebidas com leite,  destinadas ao consumo doméstico e profissional. Compramos mais de 30 variedades de café verde de origem, de mais de 17 países, incluindo o Brasil, o que nos permite criar mais de 90 blends com diferentes características, para atender aos paladares mais exigentes dos consumidores.  Além do café em grãos e moídos, disponíveis em diversos formatos, estamos entre os lideres na produção e venda no formato de cápsulas compatíveis com os principais sistemas do mercado. Estamos no Brasil há quase 05 anos, comercializando nossos produtos através de diferentes canais de distribuição, e contamos com uma equipe especializada para levar o melhor do Café Espresso Italiano à sua mesa</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"{{media url=&quot;wysiwyg/panel/gimoka_1.jpg&quot;}}\" alt=\"gimoka_1.jpg\" /> </p></div><div class=\"panel-block-row col-md-12\"></div></div></div></div></div></div>','2021-10-09 19:33:49','2021-10-09 19:52:29',1,0,NULL,'','',NULL,NULL,NULL,NULL,'');
