INSERT INTO `email_template` VALUES (1,'Novo Pedido Atualizado','{{template config_path=\"design/email/header_template\"}}\r\n\r\n<table>\r\n    <tr class=\"email-intro\">\r\n        <td>\r\n            <p class=\"greeting\">Olá, {{var customer.name}}</p>\r\n            <p>\r\n                {{trans \"Thank you for your order from %store_name.\" store_name=$store.frontend_name}}\r\n                {{trans \"Once your package ships we will send you a tracking number.\"}}\r\n                {{trans \'You can check the status of your order by <a href=\"%account_url\">logging into your account</a>.\' account_url=$this.getUrl($store,\'customer/account/\',[_nosid:1]) |raw}}\r\n            </p>\r\n            <p>\r\n                {{trans \'If you have questions about your order, you can email us at <a href=\"mailto:%store_email\">%store_email</a>\' store_email=$store_email |raw}}{{depend store_phone}} {{trans \'or call us at <a href=\"tel:%store_phone\">%store_phone</a>\' store_phone=$store_phone |raw}}{{/depend}}.\r\n                {{depend store_hours}}\r\n                    {{trans \'Our hours are <span class=\"no-link\">%store_hours</span>.\' store_hours=$store_hours |raw}}\r\n                {{/depend}}\r\n            </p>\r\n        </td>\r\n    </tr>\r\n    <tr class=\"email-summary\">\r\n        <td>\r\n            <h1>{{trans \'Your Order <span class=\"no-link\">#%increment_id</span>\' increment_id=$order.increment_id |raw}}</h1>\r\n            <p>{{trans \'Placed on <span class=\"no-link\">%created_at</span>\' created_at=$created_at_formatted |raw}}</p>\r\n        </td>\r\n    </tr>\r\n    <tr class=\"email-information\">\r\n        <td>\r\n            {{depend order_data.email_customer_note}}\r\n            <table class=\"message-info\">\r\n                <tr>\r\n                    <td>\r\n                        {{var order_data.email_customer_note|escape|nl2br}}\r\n                    </td>\r\n                </tr>\r\n            </table>\r\n            {{/depend}}\r\n            <table class=\"order-details\">\r\n                <tr>\r\n                    <td class=\"address-details\">\r\n                        <h3>{{trans \"Billing Info\"}}</h3>\r\n                        <p>{{var formattedBillingAddress|raw}}</p>\r\n                    </td>\r\n                    {{depend order_data.is_not_virtual}}\r\n                    <td class=\"address-details\">\r\n                        <h3>{{trans \"Shipping Info\"}}</h3>\r\n                        <p>{{var formattedShippingAddress|raw}}</p>\r\n                    </td>\r\n                    {{/depend}}\r\n                </tr>\r\n                <tr>\r\n                    <td class=\"method-info\">\r\n                        <h3>{{trans \"Payment Method\"}}</h3>\r\n                        {{var payment_html|raw}}\r\n                    </td>\r\n                    {{depend order_data.is_not_virtual}}\r\n                    <td class=\"method-info\">\r\n                        <h3>{{trans \"Shipping Method\"}}</h3>\r\n                        <p>{{var order.shipping_description}}</p>\r\n                        {{if shipping_msg}}\r\n                        <p>{{var shipping_msg}}</p>\r\n                        {{/if}}\r\n                    </td>\r\n                    {{/depend}}\r\n                </tr>\r\n            </table>\r\n            {{layout handle=\"sales_email_order_items\" order_id=$order_id area=\"frontend\"}}\r\n        </td>\r\n    </tr>\r\n</table>\r\n\r\n{{template config_path=\"design/email/footer_template\"}}',NULL,2,'{{trans \"Your %store_name order confirmation\" store_name=$store.frontend_name}}',NULL,NULL,'2021-09-29 18:15:23','2021-09-29 18:15:23','sales_email_order_template','{\"var formattedBillingAddress|raw\":\"Billing Address\",\"var order_data.email_customer_note|escape|nl2br\":\"Email Order Note\",\"var order.increment_id\":\"Order Id\",\"layout handle=\\\"sales_email_order_items\\\" order=$order area=\\\"frontend\\\"\":\"Order Ite