INSERT INTO `mgs_blog_post` VALUES (1,'Tipos de Grãos','tipos-de-graos','mgs_blog/h/i/historia-do-cafe.jpg','<p>Você sabia que, apesar do que muitos acreditam, o café não surgiu no Brasil? A bebida é originária da região da Etiópia e ficou</p>','<p>Você sabia que, apesar do que muitos acreditam, o café não surgiu no<br>Brasil? A bebida é originária da região da Etiópia e ficou conhecida na Europa como Vinho Árabe.</p>\r\n<p>Sabia que a principal diferença entre os tipos de café está no DNA<br>da planta? Os cafés do tipo Arábica, por exemplo, possuem 44<br>cromossomos, enquanto o tipo Robusta tem apenas 22. Isso reflete nos níveis de amargor e de cafeína dos grãos.</p>\r\n<p><img src=\"{{media url=&quot;wysiwyg/panel/Screen_Shot_2021-10-07_at_14.29.42.png&quot;}}\" alt=\"Grãos\"></p>',NULL,NULL,NULL,'admin','admin','2021-05-31 18:39:21','2021-10-07 18:21:35',1,'image','youtube','mgs_blog/0/7/0708-gimoka-fb-ig-origens-cafe_-etio_pia-04.png',NULL,'image','youtube',NULL,0,'2021-06-01 04:39:21'),(2,'Benefícios do café para a saúde','beneficios-cafe-saude','mgs_blog/b/e/beneficios-cafe.jpg','<p>Beber uma xícara de café por dia pode gerar alguns benefícios para a saúde, sabia? Devido ao estímulo proporcionado pela cafeína, nossa bebida favorita é</p>','<p>Beber uma xícara de café por dia pode gerar alguns benefícios para a saúde, sabia? Devido ao estímulo proporcionado pela cafeína, nossa bebida favorita é considerada um antidepressivo natural capaz de<br>aumentar a produção de hormônios da felicidade. Alguns estudos mostram que o café também ajuda na memória e na atenção, além de proteger contra a insuficiência cardíaca.</p>',NULL,NULL,NULL,'admin','admin','2021-05-31 18:40:05','2021-10-07 18:31:44',1,'image','youtube','mgs_blog/s/c/screen_shot_2021-10-07_at_14.38.26.png',NULL,'image','youtube',NULL,0,'2021-06-01 04:40:05'),(3,'Receita da Semana Gimoka','receita-da-semana','mgs_blog/p/a/pave-cafe-gimoka.jpg','<p>A sobremesa que não pode faltar na mesa de natal, agora em versão especial para os coffee lovers.</p>','<p>A sobremesa que não pode faltar na mesa de natal, agora em versão especial para os coffee lovers.</p>\r\n<p>Aprenda a fazer um pavê de café delicioso e superfácil</p>\r\n<h5><strong>Ingredientes</strong></h5>\r\n<p><strong>1 pacote de bolacha maizena</strong><br><strong>1 lata de leite condensado</strong><br><strong>1 lata de creme de leite</strong><br><strong>50ml de café sabor Deciso*</strong><br><strong>1 colher de sopa de margarina</strong><br><strong>Leite para molhar as bolachas, o quanto baste</strong><br><strong>Raspas ou granulado de chocolate para decorar</strong></p>\r\n<h5>Modo de preparo</h5>\r\n<p>Como se fosse um brigadeiro, faça um creme com o leite condensado, a margarina e o café. Quando estiver morno, desligue o fogo e inclua o creme de leite.</p>\r\n<p>Em um recipiente da sua preferência, alterne camadas de creme e bolachas rapidamente molhadas no<br>leite. Decore com as raspas ou o granulado de chocolate. Leve à geladeira e sirva bem gelado.</p>\r\n<p>*Deciso é compatível com as máquinas Dolce Gusto**, Nespresso** e 3 Corações**</p>\r\n<p>**Marca Registrada sem nenhum vínculo comercial com o Gruppo Gimoka e/ou suas sociedades</p>\r\n<p>interligadas.</p>',NULL,NULL,NULL,'admin','admin','2021-05-31 18:40:40','2021-10-07 12:32:51',1,'image','youtube','mgs_blog/1/2/1210_gmk_social-receita_de_pave_para_o_natal-fb.jpg',NULL,'image','youtube',NULL,0,'2021-06-01 07:40:40');
