lock; margin-left: auto; margin-right: auto;\" src=\"{{media url=&quot;wysiwyg/panel/gimoka_1.jpg&quot;}}\" alt=\"gimoka_1.jpg\" /> </p>'),(55,16,'block22-0',NULL,'static',2,'{\"animation\":\"\",\"animation_delay\":\"\"}',12,NULL,1,0,NULL),(56,2,'block11-0',NULL,'new_products',2,'{\"title\":\"NEWS\",\"additional_content\":\"\",\"animation\":\"\",\"animation_delay\":\"\",\"limit\":\"8\",\"perrow\":\"4\",\"numbercol\":\"1\",\"percol\":\"\",\"template\":\"grid.phtml\",\"ratio\":\"1\",\"use_slider\":\"1\",\"number_row\":\"1\",\"navigation\":\"1\",\"pagination\":\"1\",\"text_colour\":\"\",\"link_colour\":\"\",\"link_hover_colour\":\"\",\"button_colour\":\"\",\"button_hover_colour\":\"\",\"button_text_colour\":\"\",\"button_text_hover_colour\":\"\",\"button_border_colour\":\"\",\"button_border_hover_colour\":\"\",\"autoplay\":0,\"stop_auto\":0,\"use_tabs\":0,\"loadmore\":0}',12,NULL,1,0,'{{block class=\"MGS\\Mpanel\\Block\\Products\\NewProducts\" mgs_panel_title=\"NEWS\" mgs_panel_note=\"\" limit=\"8\" ratio=\"1\" category_ids=\"\" use_slider=\"1\" loadmore=\"0\" template=\"products/new/grid.phtml\" perrow=\"4\" autoplay=\"0\" stop_auto=\"0\" navigation=\"1\" pagination=\"1\" number_row=\"1\"}}'),(60,2,'block16-0',NULL,'static',1,'{\"animation\":\"\",\"animation_delay\":\"\"}',12,NULL,1,0,NULL),(61,2,'block11-0',NULL,'category_products',3,'{\"title\":\"Ph\\u1ee5 ki\\u1ec7n\",\"additional_content\":\"\",\"animation\":\"\",\"animation_delay\":\"\",\"limit\":\"8\",\"perrow\":\"3\",\"numbercol\":\"1\",\"percol\":\"\",\"template\":\"grid.phtml\",\"ratio\":\"1\",\"use_slider\":\"1\",\"number_row\":\"1\",\"autoplay\":\"1\",\"stop_auto\":\"1\",\"navigation\":\"1\",\"pagination\":\"1\",\"category_id\":[\"12\"],\"text_colour\":\"\",\"link_colour\":\"\",\"link_hover_colour\":\"\",\"button_colour\":\"\",\"button_hover_colour\":\"\",\"button_text_colour\":\"\",\"button_text_hover_colour\":\"\",\"button_border_colour\":\"\",\"button_border_hover_colour\":\"\",\"use_tabs\":0,\"loadmore\